import { Card, Avatar, Button, Divider } from "antd";

const UserProfile = () => {
  return (
    <>
      <Card
        actions={[
          <div key="twit">
            짹쨱
            <br />0
          </div>,
          <div key="followings">
            팔로잉
            <br />0
          </div>,
          <div key="followings">
            팔로워
            <br />0
          </div>,
        ]}
      >
        <Card.Meta avatar={<Avatar>Ad</Avatar>} title="AngryDuck"></Card.Meta>
        <Button>로그아웃</Button>
      </Card>
    </>
  );
};

export default UserProfile;
